import React from 'react'
import { connect } from 'react-redux';
import './Profile.css'
import {Link} from 'react-router-dom'
import { LogOut } from '../reducer/actions'


class Profile extends React.Component {



handleLogOutClick = () => {

    localStorage.removeItem("token")
    localStorage.removeItem("id")

    this.props.LogOut()

}

    render(){
     console.log(localStorage, this.props.user.img_url, this.props.user.username)
        return (

            <div className="info">

                <img src="https://uberhumor.com/wp-content/uploads/2019/07/xjkwe7eyqda31.png" alt={this.props.user.username} />
                <div>{this.props.user.username}</div>
                <Link to="/"><button onClick={this.handleLogOutClick} className="ui teal button">Logout</button></Link>
            </div>

        )
    }
}

const mapStateToProps = (state) => {
    return {
       user: state.user
    }
}

export default connect(mapStateToProps, {LogOut})(Profile)
